import React from 'react';
import Proptypes from "prop-types";

function Food({name, picture, kda}) {
  return (
    <div>
      <h2>{name}</h2>
      <h5>K/D/A : {kda}</h5>
      <img src={picture} alt={name}></img>
    </div>
  );
}

const foodlike = [
  {
    id : 1,
    name : "Faker",
    image : "data:image/jpeg;base64,",
    kda : 5.1
  },
  {
    id : 2,
    name : "Deft",
    image : "data:image/jpeg;base64,",
    kda : 4.9
  },
  {
    id : 3,
    name : "Ruler",
    image : "data:image/jpeg;base64,",
    kda : 8.8
  },
  {
    id : 4,
    name : "Kiin",
    image : "data:image/jpeg;base64,",
    kda : 3.1
  }
];

Food.prototype = {
  name : Proptypes.string.isRequired,
  picture : Proptypes.string.isRequired,
  kda : Proptypes.number.isRequired
};

function App() {
  return (
    <div>
      {foodlike.map(dish => (
      <Food 
        key={dish.id} 
        name={dish.name} 
        picture={dish.image}
        kda = {dish.kda}
      />
      ))}
    </div>
  );
}

export default App;
